    public static int wordCount(String[] startWords, String[] targetWords) {
        int res = 0;
        for (int i = 0; i < targetWords.length; i++) {
            ArrayList<Character> dict = new ArrayList();
            for (int j = 0; j < targetWords[i].length(); j++) {
                dict.add(targetWords[i].charAt(j));
            }

            boolean isFound = false;

            for (int j = 0; j < startWords.length; j++) {
                if (targetWords[i].length() - startWords[j].length() != 1) {
                    continue;
                }

                ArrayList<Character> temp = new ArrayList(dict);
                ArrayList<Character> tempStartWord = new ArrayList();
                if (!targetWords[i].equals(startWords[j])) {
//                    System.out.println("temp: " + temp);
                    for (int k = 0; k < startWords[j].length(); k++) {
                        tempStartWord.add(startWords[j].charAt(k));
                        if (temp.contains(startWords[j].charAt(k))) {
                            temp.remove(temp.indexOf(startWords[j].charAt(k)));
                            tempStartWord.remove(tempStartWord.indexOf(startWords[j].charAt(k)));
                        } else {
                            break;
                        }
                    }
//                    System.out.println("targetWords[i]: " + targetWords[i] + " | startWords[j]:" + startWords[j]);
//                    System.out.println("temp: " + temp);
                    if (temp.size() == 1 && tempStartWord.size() == 0) {
//                        System.out.println("masuk");
                        isFound = true;
                        break;
                    }
                }
            }

            if (isFound) {
                res++;
            }
        }
        return res;
    }
